sigfillset(&all_sigs);
// Block signals in main before spawning threads
pthread_sigmask(SIG_BLOCK, &all_sigs, NULL);

g.text:
c
void* sig_thread(void* arg) {
    int sig;
    sigwait(&set, &sig); // Synchronous
    pool->shutdown = 1;
    pthread_cond_broadcast(&pool->cond);
    return NULL;
}
